function VariableModal() {
  return (
    <>
      <div className="w-screen h-screen inset-0 fixed">
        <div className="w-screen h-screen inset-0 fixed bg-[rgba(49,49,49,0.8)]">
          <div className="absolute -translate-x-2/4 -translate-y-2/4 leading-[1.4] max-w-[600px] min-w-[300px] px-7 py-3.5 rounded-[3px] left-2/4 top-[40%]; bg-main-color">tEST</div>
        </div>
      </div>
    </>
  );
}

export default VariableModal;
